import React, { Component } from 'react';
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
            <a className="f6 link dim br-pill ph3 pv2 mb2 dib white bg-black" href="#0">Button Text</a>

      </div>
    );
  }
}

export default App;
